INSERT INTO `tbl_operative_performance_evaluation` VALUES (1,13,3,'80','50','80','80','80','50','80','100','100',700,'77.77777777777777','Me gusta el  trabajo que desempeño pues gracias a el he aprendido cosas nuevas me siento satisfecha   y cada día  le pido a dios por el bienestar de la  compañía y las personas que laboramos allí  ','Formacion','2',NULL,'Formacion','3',NULL,'','0',NULL,'Formación en Manejo de Alimentos.\nFormación en Herramientas para la comunicación Asertiva',NULL,1,NULL),(2,17,42,'100','100','80','80','100','80','100','100','100',840,'93.33333333333333','Durante mi desempeño en la compañía he logrado poner en practica todos mis conocimientos y de esta manera ayudar a la empresa en la organización de los almacenes. \nTambién he desempeñado mis funciones de una forma responsable y organizada logrando corresponder con la confianza que se me ha brindado.  ','Supervision','3',NULL,'','0',NULL,'','0',NULL,'Cumple las tareas asignadas con responsabilidad, siempre con enfoque de ayudar la empresa, siguiendo procedimientos y colaborando a las demás áreas ',NULL,1,NULL),(3,18,42,'100','100','80','100','100','100','100','80','100',860,'95.55555555555556','considero que soy un trabajador constante, efectivo, eficiente, me gusta desempeñar mis oficios de la mejor manera posible, tengo muy buenas habilidades para desempeñar las tareas que se me asignen.','Supervision','3',NULL,'','0',NULL,'','0',NULL,'Cumple inmediatamente con las tareas que se le asignan, siempre con la mejor intensión y en pro de mejora para la organización.\nPor mejorar la adaptación al cambio.',NULL,1,NULL),(4,46,12,'100','80','80','100','80','80','100','80','50',750,'83.33333333333333','Mi compromiso con la empresa y productividad siempre trato de hacer lo mejor que puedo y procuro adaptarme a los cambios ','Reinduccion','4',NULL,'','0',NULL,'','0',NULL,'\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nReinduccion acerca de la puntualidad y de las normas de la compañia en cuanto a normas y politica interna por parte del area de RRHH, y refuerzo acerca del no cumplimiento y nuestro derecho a realizar el debido proceso.\nCapacitacion en salud financiera\nCapacitacion en tecnicas de superacion personal  \n\n',NULL,1,NULL),(5,47,12,'100','80','100','100','100','100','100','80','80',840,'93.33333333333333',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL),(6,48,12,'100','80','100','100','100','80','100','100','100',860,'95.55555555555556','Gracias a la compañía por darme la oportunidad de llegar a ser lo que hoy soy: un trabajador con gran sentido de responsabilidad, y dispuesto a seguir el plan de trabajo y lograr con eficiencia las metas trazadas. Con iniciativa de seguir escalando dentro de la compañía. ','Formacion','1',NULL,'','0',NULL,'','0',NULL,'Capacitacion en salud financiera\nCapacitacion en tecnicas de superacion personal',NULL,1,NULL),(7,64,3,'80','50','80','80','80','80','80','80','100',710,'78.88888888888889','He mejorado 50% en mi desempeño laboral y la calificasion estoy de acuerdo y excelente jefe tengo y seguire mejorando','Formacion','2',NULL,'Formacion','3',NULL,'','0',NULL,'Capacitación en Manejo de Alimentos.\nCapacitación en Comunicación Asertiva',NULL,1,NULL),(8,67,39,'80','80','80','100','100','100','100','80','50',770,'85.55555555555556','Mi desempeño durante este año, ha sido de continuo aprendizaje buscando un mejoramiento continuo, bajo una organización y una participación activa con el fin a una adaptación al cambio y su vez buscando una mejora en la puntualidad como también en las relaciones internas. Lo anterior con el propósito de mostrar mis habilidades y capacidades que pueden aportar a la empresa, apoyando el logro de objetivos tanto del área como de la misma compañía.','Supervision','4',NULL,'','0',NULL,'','0',NULL,'Como primer instancia se ha hecho retroalimentación al trabajador para dar a conocer la importancia de cada uno de los criterios evaluados en el desempeño. Para trabajar en los ítems a mejorar, se planea involucrar más al trabajador en las actividades que se desarrollan en el proceso con el fin de que pueda reconocer la importancia de su rol y así mismo exigir que ella se esfuerce por mejorar y desenvolverse mejor en el ambiente laboral. La idea es poder llevar un seguimiento mensual y verificar que tan eficaz está siendo el plan de acción. ',NULL,1,NULL),(10,73,51,'80','50','80','100','80','80','50','50','100',670,'74.44444444444444','Agradezco la calificación, buscaré estrategias para mejorar los aspectos en cuanto a comunicación. ','Formacion','3',NULL,'Supervision','3',NULL,'','0',NULL,'Se caracteriza por aprender y ejecutar de manera rápida las actividades que se deben realizar en el área, demuestra interés y despeja las dudas de manera oportuna además de ser una persona ordenada con documentación y cronogramas de actividades. \nDebe fortalecer la comunicación y participar de manera mas activa en las reuniones de área. ',NULL,1,NULL),(11,74,46,'80','80','80','80','50','80','80','80','50',660,'73.33333333333333','Mi desempeño dentro de la compañía ha sido excelente doy lo mejor posible por ser más organizado pero si la ingeniera no es organizada con las órdenes de trabajo yo no puedo comprometeme a ser más organizado y lo de la puntualidad estoy en desacuerdo porque teniendo en cuenta que yo vivo en otro municipio y muchas de las veces uno está Excepto a que las máquinas presenten cualquier falla o obstáculos en el camino para uno ser puntual en la empresa o a la compañía','Formacion','1',NULL,'','0',NULL,'','0',NULL,'Fomentar a los trabajadores la importancia de llegar a cualquier reunion 5 min antes a excepción que halla un imprevisto no se tomara en cuenta, ayudarnos  con nuestro telefono con alarma ya que las distancias son largas por parte del grupo de ingenieria se avisara con anticipación.',NULL,1,NULL),(12,75,56,'80','80','80','80','100','80','80','80','25',685,'76.11111111111111','Estoy deacuerdo con los porsentajes, ecepto con el de relaciones, ya que me concidero una persona que se lleva muy bien con mis compañeros y superiores. ','Formacion','2',NULL,'Plan de Desarrollo','3',NULL,'Supervision','4',NULL,'es una persona proactiva, servicial con sus compañeros posee amplio conocimiento en el área de electricidad y mecánica falta enfocar  y mejorar un poco en la parte de control eléctrico , servicial con los demás colaboradores y areas  es necesario mejorar en el tema de la puntualidad .','Un  técnico que demuestra una actitud de querer aprender e innovar, debe estar más enfocado al detalle ya que se han encontrado varías fallas por falta de cuidado, al igual que mejorar la puntualidad.  ',1,NULL),(13,76,56,'80','50','50','25','50','80','80','80','100',595,'66.11111111111111','Me siento confirme con ka calificacion ','Plan de Desarrollo','2',NULL,'Promocion','3',NULL,'','0',NULL,'es una persona muy proactiva en lo que hace, genera muy buenas ideas al equipo  se debe mejorar en la técnica para algunos equipos en particular, es un técnico con muchas habilidades y disposición para aprender distintas diciplinas  ',NULL,1,NULL),(14,77,56,'50','80','80','25','100','50','100','100','80',665,'73.88888888888889','me comprometo a seguir aprendiendo, seguir ejerciendo mis conocimientos para mejorar los procesos, ser más detallista en los trabajos ejecutados y cada vez superarme más. ','Formacion','1',NULL,'Reinduccion','2',NULL,'Promocion','4',NULL,'es un colaborador dedicado en la parte administrativa , falta perfeccionar algunas habilidades  en la parte  eléctrica , mecánica , tiene buena disposición para  recibir retroalimentación y feedback . es importante fortalecer las habilidades de compromiso y productividad.','El promedio de calificación es el mismo, solo veo que se debe tener mejoras en Habilidades de comunicación, organización y un poco en la puntualidad, y se le debe aumentar en compromiso y aprendizaje y desarrollo, es un técnico que tiene una buena disposición de aprender con buenos valores y trato hacía sus demás compañeros, debe estar más enfocado al detalle y mejorar la comunicación la cual es la base del aprendizaje en estás áreas.',0,NULL),(15,78,56,'80','50','50','50','100','100','50','50','100',630,'70','Mi desempeño fue excelente  ya que contribuí con grandes proyectos en la empresa ','Reinduccion','1',NULL,'Supervision','2',NULL,'','0',NULL,'es un colaborador muy efectivo tiene amplio conocimiento en varias  especialidades como soldadura , electricidad y mecánica es una persona muy ordenada y pulcra en sus labores falta mejorar algunos aspectos como la actitud hacia el grupo de trabajo y demás colaboradores de la compañía.  ',NULL,1,NULL),(16,79,56,'50','80','80','50','50','80','80','80','80',630,'70','Estoy de acuerdo con la calificación y mi punto de vista esq e mejorado como empleado y persona , gracias a mis compañeros y mis superiores y e aprendido bastante gracias a ellos ','Reinduccion','2',NULL,'Plan de Desarrollo','3',NULL,'','0',NULL,'es un colaborador muy proactivo tiene muy buena disposición para el aprendizaje , se nota mucho el avance en su capacidad técnica aunque falta mejorar un poco en la parte de compromiso para atender las novedades de emergencia  , es una persona muy abierta a las retroalimentaciones.',NULL,1,NULL),(17,83,64,'80','80','80','100','50','80','50','80','100',700,'77.77777777777777','Ha sido un año de mucho aprendizaje y con cosas por mejorar ','Formacion','1',NULL,'','0',NULL,'','0',NULL,'Es una persona responsable, comprometida y puntual ',NULL,1,NULL),(18,84,64,'80','80','80','80','80','50','80','80','80',690,'76.66666666666667','mejor desempeño laboral y compromiso con la empresa','Formacion','1',NULL,'','0',NULL,'','0',NULL,'Es una persona comprometida con su labora, puntual con fácil adaptación a los cambios.\n','El resultado d ela evaluacion es correcto',1,NULL),(19,85,64,'80','50','100','80','80','80','80','80','80',710,'78.88888888888889','soy responsable en el area de trabajo y dar n buen ejemplo a mis compañeros que me rodean ','Promocion','1',NULL,'','0',NULL,'','0',NULL,'Se promueve como líder por su compromiso, responsabilidad y conocimientos de las areas, su esfuerzo con las actividades desarrolladas cada dia con nuestra compañía.','El r esultado de la evaluacion es correcto',1,NULL),(20,86,64,'80','80','80','100','80','80','80','80','100',760,'84.44444444444444','me gusta mucho lo q hago y me gusta el trato de mis ingenieros me siento contenta con lo que hago y gracias a los ingenieros por la oportunidad que me an dado ','Formacion','1',NULL,'','0',NULL,'','0',NULL,'Es una persona puntual, responsable  y comprometida con su trabajo, se necesitaría reforzar con  capacitación en manejo de personal y demás temas acorde al área y su liderazgo  ','Se.aprueba resultado',1,NULL),(21,87,63,'100','80','80','80','80','100','100','100','100',820,'91.11111111111111','estoy  de acuerdo  con lo anterior dicho','Formacion','3',NULL,'Plan de Desarrollo','3',NULL,'','0',NULL,'Dory Castellanos demuestra alto compromiso y dedicación hacia su trabajo. Se requiere seguir en la mejora continua mediante capacitaciones y seguimiento a su desempeño ','El resultado de la evaluación corresponde con el desempeño observado',1,NULL),(22,88,63,'100','50','80','100','80','100','100','100','50',760,'84.44444444444444','Si estoy de acuerdo con la calificación recibida. ','Formacion','3',NULL,'Plan de Desarrollo','3',NULL,'Supervision','3',NULL,'Juan Troncoso demuestra compromiso por su trabajo y un buen conocimiento acerca de las labores que desempeña. Se requiere mantener y ampliar la capacitación enfocada principalmente en herramientas de liderazgo y direccionamiento del trabajo, adicional es necesario mantener la evaluación y supervisión de responsabilidades de forma constante que permitan una mejora continua del colaborador ','El resultado de la evaluación corresponde con el desempeño observado',1,NULL),(23,89,64,'80','80','80','80','80','50','80','80','100',710,'78.88888888888889','Me siento orgulloso de pertenecer a esta empresa, me han dado la oportunidad de escalar y aprende dia a dia mas de mis labores y compromisos adquiridos dia a dia.','Formacion','1',NULL,'','0',NULL,'','0',NULL,'Es una persona correcta, puntual y muy trabajadora, se requiere capacitación para manejo de personal y temas afines para el área de ASPERCION.','El resultado de la evaluación corresponde con el desempeño observado',1,NULL),(24,90,64,'100','80','80','80','80','80','100','80','100',780,'86.66666666666667','soy una persona responsable PUNTUAL y acato las ordenes de mis supervisores y cada dia mejorando mas en mi desempeño','Formacion','1',NULL,'','0',NULL,'','0',NULL,'Es una persona respetuosa, puntual y con gran facilidades de adaptación al cambio, brinda apoyo e ideas viables para el proceso, compañerista','El resultado de la evaluación corresponde con el desempeño observado',1,NULL),(25,91,63,'100','80','80','100','100','100','80','100','100',840,'93.33333333333333','Estoy de acuerdo con los resultados recibidos. ','Formacion','3',NULL,'Plan de Desarrollo','3',NULL,'','0',NULL,'Raquel Zabala muestra un buen desempeño en su labor de líder además de un alto compromiso para con sus labores. Se requiere una continua capacitación enfocada mayormente a fortalecer temas de liderazgo que permitan la mejora continua. ','El resultado de la evaluación corresponde con el desempeño observado',1,NULL),(26,92,63,'100','80','100','100','100','80','100','100','100',860,'95.55555555555556','Estoy de acuerdo con los resultados recibidos. ','Formacion','3',NULL,'Plan de Desarrollo','3',NULL,'','0',NULL,'Milena Olivares demuestra gran liderazgo en su proceso además de un alto compromiso y buen desempeño en sus labores. Se requiere seguir en capacitación continua con un enfoque que fortalezca sus capacidades de liderazgo y a su vez continuar con su evaluación de desempeño que permita la mejora continua. ','El resultado de la evaluación corresponde con el desempeño observado',1,NULL),(27,93,63,'80','100','100','80','80','80','100','80','100',800,'88.88888888888889','Estoy de acuerdo con mi calificación recibida.','Formacion','3',NULL,'Plan de Desarrollo','3',NULL,'','0',NULL,'Yeferson Rivera demuestra buen compromiso para con su trabajo y un buen desempeño en sus labores. Se requiere continuar con un plan de capacitan que permita fortalecer sus capacidades además de seguir una evaluación de desempeño que permita una mejora continua. ','El resultado de la evaluación corresponde con el desempeño observado',1,NULL),(28,94,63,'100','80','80','80','100','80','100','100','100',820,'91.11111111111111','Estoy de acuerdo con la calificación recibida ','Formacion','3',NULL,'Plan de Desarrollo','3',NULL,'','0',NULL,'Laura Castañeda demuestra un buen compromiso para con su trabajo y a su vez un buen desempeño. Se requiere fortalecer basado en capacitación las capacidades comunicativas y seguir en la mejora continua bajo la evaluación de su desempeño. ','El resultado de la evaluación corresponde con el desempeño observado',1,NULL),(29,95,64,'50','50','50','50','80','80','50','50','50',510,'56.666666666666664','Me siento muy bien con la empresa y el personal, igualmente con motivación para mejorar cada día más ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL),(30,96,64,'80','80','80','80','50','80','80','80','100',710,'78.88888888888889','con respecto a lo personal me considero una persona pro activa en las actividades asignadas y con respecto ala empresa mas presensia de salud y seguridad en el trabajo y capasitasion de riesgos mas frecuentes ','Formacion','1',NULL,'','0',NULL,'','0',NULL,'Es una persona puntual, respetuosa y con grandes habilidades de mejora se requiere capacitaciones de manejo documental ','El resultado de la evaluación c